function remove_tracking_parcel(b,a){jQuery("#tracking_parcel_fields div#parcel_overlay").show();jQuery.post(ajaxurl,{id:b,order_id:jQuery("#tracking_parcel_fields input[name=order_id]").val(),action:"remove_tracking_parcel"},function(c){jQuery(".tracking-list").html(c);jQuery("#tracking_parcel_fields div#parcel_overlay").hide()});return false}jQuery(document).ready(function(){jQuery("#tracking_parcel_fields input[type=button]").on("click",function(b){b.preventDefault();var a={};jQuery("#tracking_parcel_fields div#parcel_overlay").show();jQuery("#tracking_parcel_fields input").each(function(){var c=jQuery(this);if("notify"==c.attr("name")&&!c.is(":checked")){return}a[c.attr("name")]=c.val()});a.action="add_tracking_parcel";jQuery.post(ajaxurl,a,function(c){jQuery(".tracking-list").html(c);jQuery("#tracking_parcel_fields div#parcel_overlay").hide()})})});